import React, { Profiler, useEffect } from 'react';
import './App.css';

const onRenderCallback = (
  id,
  phase,
  actualDuration,
  baseDuration,
  startTime,
  commitTime,
  interactions
) => {
  console.log({ id, phase, actualDuration, baseDuration, startTime, commitTime, interactions });
};

const simulateLongTask = (duration) => {
  const end = Date.now() + duration;
  while (Date.now() < end) {
    // Perform some dummy calculations to keep the CPU busy
    Math.sqrt(Math.random() * Math.random());
  }
  console.log(`Simulated long task for ${duration}ms`);
};

const simulateTasks = () => {
  simulateLongTask(4000);  // Long task of 4000ms
  for (let i = 0; i < 5; i++) {
    simulateLongTask(200);  // Long tasks of 200ms
  }
};

function App() {
  useEffect(() => {
    simulateTasks();
  }, []);

  return (
    <Profiler id="App" onRender={onRenderCallback}>
      <div className="App">
        <header className="App-header">
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
        </header>
      </div>
    </Profiler>
  );
}

export default App;
